import React from 'react'
import project from '../../components/section/projects/timeline/project'

const AllProjects = () => {
  return (
    <>
    {project.map(element => {
        <div>
            {console.log(element.title)}
            {element.title}
        </div>
      })}
    </>

  )
}

export default AllProjects
